        _grpBars.append("rect")
          .attr("class", "HC-bars")
          .attr("x", 1)
          .attr("transform", (d) => { return "translate(" + `${this._x(d) + (this._x.bandwidth() / this._documentType.size) * index}` + "," + this._y(this._orderedDocumentArray[d].length) + ")"; })
